	void CGameMap::beAir(int x, int y, int x2, int y2) {
		int gx = x / MW;		
		int gy = y / MH;
		int gx2 = x2 / MW;		
		int gy2 = y2 / MH;
		for (int i = gy; i <= gy2; i++) {
			for (int j = gx; j <= gx2; j++) {
				map[i][j] = 1;
			}
		}
	}
