	int CGameMap::IsPipe(int x, int y,CEraser *c) {
		int gx = x / MW;
		int gy = y / MH;
		if (map[gy][gx] == 9) {
			if (c->getNowIsPipeGoToUp()) {
				Stop_x = 170;
				Stop_y = 300;
			}
			if (c->getNowIsPipeGoToDown()) {
				Stop_x = 320;
				Stop_y = 200;
			}
			return 0;
		}
		if (map[gy][gx] == 21) {
			if (c->getNowIsPipeGoToUp()) {
				Stop_x = 180;
				Stop_y = 100;
			}
			if (c->getNowIsPipeGoToDown()) {
				Stop_x = 320;
				Stop_y = 270;
			}
			return 1;
		}
		if (map[gy][gx] == 23) {
			if (c->getNowIsPipeGoToUp()) {
				Stop_x = 340;
				Stop_y = 100;
			}
			if (c->getNowIsPipeGoToDown()) {
				Stop_x = 75;
				Stop_y = 250;
			}
			return 2;
		}
		if (map[gy][gx] == 25) {
			if (c->getNowIsPipeGoToUp()) {
				Stop_x = 290;
				Stop_y = 150;
			}
			if (c->getNowIsPipeGoToDown()) {
				Stop_x = 75;
				Stop_y = 250;
			}
			return 3;
		}
		return -1;
	}
