	void CGameMap::OnMove(CEraser *c) {
		const int STEP_SIZE_L = 6;
		const int STEP_upL_SIZE = 15;
		const int STEP_downL_SIZE = 6;
		const int CHANGVIEW_SIZE_FOR_SX = 15;
		const int CHANGVIEW_SIZE_FOR_SY = 9;
		TRACE("savesx:%d\n", savePointSx);
		TRACE("savesy:%d\n", savePointSy);
		if (isMovingRight)
		{
			if (ScreenX(c->GetX1()) < Stop_x)
				isMovingRight = false;
			else sx += CHANGVIEW_SIZE_FOR_SX;
			//TRACE("%d\n", Stop_x);
		}
		if (isMovingLeft)
		{
			if (ScreenX(c->GetX1()) > Screen_Width - Stop_x)
				isMovingLeft = false;
			else sx -= CHANGVIEW_SIZE_FOR_SX;
		}
		if (isMovingDown)
		{
			if (ScreenY(c->GetY1()) <  Stop_y)
				isMovingDown = false;
			else sy += CHANGVIEW_SIZE_FOR_SY;
		}
		if (isMovingUp)
		{
			if (ScreenY(c->GetY1()) > Screen_Height - Stop_y)
				isMovingUp = false;
			else sy -= CHANGVIEW_SIZE_FOR_SY;		
		}
		if (isMovingRight || isMovingLeft || isMovingDown || isMovingUp) {
			savePointSx = sx;
			savePointSy = sy;
		}
		//停止視角移動
			

        /////
		if (isMovingLeftL)
			sx -= STEP_SIZE_L;
		if (isMovingRightL)
			sx += STEP_SIZE_L;
		if (isMovingUpL )
			sy -= STEP_upL_SIZE;
		if (isMovingDownL)
			sy += STEP_downL_SIZE;

	}
